import{_ as e,o,c as a,O as r}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 54.1-3603 Board of Psychology; membership.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/54.1-3603.md","filePath":"vacode/54.1-3603.md"}'),t={name:"vacode/54.1-3603.md"},s=r('<h1 id="§-54-1-3603-board-of-psychology-membership" tabindex="-1">§ 54.1-3603 Board of Psychology; membership. <a class="header-anchor" href="#§-54-1-3603-board-of-psychology-membership" aria-label="Permalink to &quot;§ 54.1-3603 Board of Psychology; membership.&quot;">​</a></h1><p>The Board of Psychology shall regulate the practice of psychology. The membership of the Board shall be representative of the practices of psychology and shall consist of nine members as follows: five persons who are licensed as clinical psychologists, one person licensed as a school psychologist, one person licensed in any category of psychology, and two citizen members. At least one of the seven psychologist members of the Board shall be a member of the faculty at an accredited institution of higher education in the Commonwealth actively engaged in teaching psychology. The terms of the members of the Board shall be four years.</p><p>1976, c. 608, § 54-937; 1981, c. 447; 1982, c. 165; 1985, c. 159; 1986, cc. 464, 510; 1988, cc. 42, 765; 1996, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?961+ful+CHAP0937" target="_blank" rel="noreferrer">937</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?961+ful+CHAP0980" target="_blank" rel="noreferrer">980</a>; 2019, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0169" target="_blank" rel="noreferrer">169</a>.</p>',3),c=[s];function i(l,n,h,p,f,d){return o(),a("div",null,c)}const _=e(t,[["render",i]]);export{m as __pageData,_ as default};
